import SuzyBaePic from "../assets/SuzyBaePic.png";
import UserInfoGrid from "./UserInfoGrid";
import { useState, useEffect } from "react";

const UserProfile = ({ userData }) => {

  

  useEffect(() => {
    async function apiCall() {
      console.log(userData.topThreeMovies[0])
    }
    apiCall();
  }, []);

  const [selectedUserInfo, setSelectedUserInfo] = useState("Fav Movies");

  const handleEdit = () => {

  }

    return (
      <div>
      <div className="flex items-center p-4 w-full">
        <div className="flex  flex-col">
          {/* User Information Section */}
          <div className="relative flex flex-col items-center w-80 h-60">
            <div className="h-40 w-40 md rounded-full relative avatar flex items-end justify-end text-purple-600 min-w-max absolute -top-16 flex bg-purple-200 text-purple-100 row-start-1 row-end-3 text-purple-650 ring-1 ring-white">
            <img className="h-40 w-40 md rounded-full relative" src={SuzyBaePic} alt=""></img>
            <div className="absolute"></div>
          </div>
        <div className="flex flex-col space-y-1 justify-center items-left -mt-12 w-80">
          <span className="font-bold text-xl text-center text-gray-800 hover:text-lime-500 hover:cursor-pointer ">{userData.name}</span>
          <p className="text-gray-600 text-sm text-center">@{userData.handle}</p>
          <p className="text-black-600 text-sm text-center">{userData.statusMsg}</p>
          <p className="text-black-600 text-sm text-center">{userData.additionalInfo}</p>
          
        {/* Follow & Message Buttons */}
        <div className="flex flex-row justify-center font-semibold mx-auto my-4 w-40">
          <div className="my-auto text-white bg-lime-500 hover:bg-lime-600 hover:cursor-pointer rounded-3xl py-2 px-4 mx-2">Follow</div>
          <div className="my-auto text-white bg-gray-400 hover:bg-gray-500 hover:cursor-pointer rounded-3xl py-2 px-4 mx-2" onClick={handleEdit}>Edit</div>
          {/* <div class="my-auto text-gray-800 py-1 px-4 border-2 border-lime-500 hover:bg-lime-500 hover:cursor-pointer hover:text-white rounded-3xl mx-2">Add to Box</div> */}
        </div>
        </div>
      </div> 
      
      </div>
      {/* User TOP 3 Favorite Movies Display */}
      <div className="flex flex-row h-60 w-full justify-end"> 
            <div className="flex flex-row bg-lime-100 justify-center my-6 w-2/5 h-4/5 rounded-xl mr-8">
              {userData.topThreeMovies.map((movie) => (
                <div className="my-auto text-gray-800 border-2 border-yellow-500 mx-2 w-32 h-40 text-center">{movie}</div>
              ))}
            </div>
      </div>
    </div>
    {/* Bottom Tabs Section */}
    {/* Fav Movies, To Watch, Friends, Watch Groups */}
    <div className="text-sm flex flex-row w-full justify-center font-medium text-gray-500 border-b border-gray-200 dark:text-gray-400 dark:border-gray-700 mt-20 mb-8">
              <div clasNames="flex -mb-px w-full justify-center">
                  <div className="mr-2 w-1/4 flex justify-center" onClick={() => { setSelectedUserInfo("Fav Movies"); }}>
                      <span className={selectedUserInfo == "Fav Movies" ? 
                      "inline-block p-4 text-lime-600 border-b-2 border-lime-600 rounded-t-lg active dark:text-lime-500 dark:border-lime-500" : 
                      "inline-block p-4 border-b-2 border-transparent rounded-t-lg hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300"}>Fav Movies</span>
                  </div>
                  <div className="mr-2 w-1/4 flex justify-center" onClick={() => { setSelectedUserInfo("To Watch"); }}>
                      <span className={selectedUserInfo == "To Watch" ? 
                      "inline-block p-4 text-lime-600 border-b-2 border-lime-600 rounded-t-lg active dark:text-lime-500 dark:border-lime-500" : 
                      "inline-block p-4 border-b-2 border-transparent rounded-t-lg hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300"}>To Watch</span>
                  </div>
                  <div className="mr-2 w-1/4 flex justify-center" onClick={() => { setSelectedUserInfo("Friends"); }}>
                      <span className={selectedUserInfo == "Friends" ? 
                      "inline-block p-4 text-lime-600 border-b-2 border-lime-600 rounded-t-lg active dark:text-lime-500 dark:border-lime-500" : 
                      "inline-block p-4 border-b-2 border-transparent rounded-t-lg hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300"}>Friends</span>
                  </div>
                  <div className="mr-2 w-1/4 flex justify-center" onClick={() => { setSelectedUserInfo("Watch Groups"); }}>
                      <span className={selectedUserInfo == "Watch Groups" ? 
                      "inline-block p-4 text-lime-600 border-b-2 border-lime-600 rounded-t-lg active dark:text-lime-500 dark:border-lime-500" : 
                      "inline-block p-4 border-b-2 border-transparent rounded-t-lg hover:text-gray-600 hover:border-gray-300 dark:hover:text-gray-300"}>Watch Groups</span>
                  </div>
              </div>
          </div>
          <UserInfoGrid userData={userData} selectedUserInfo={selectedUserInfo} />
     </div>
         
 );

}

export default UserProfile;
